  ["date", "Nov 15 , 2021"],
  ["wedding_venue", "Garden Resort"],
  ["baraat_time", "12 am"],
  ['feere_time',"1 pm"],
]);


const element = React.createElement('ol', null,
  info_hashmap.forEach(element => {
    React.createElement('li',null,element)
  })
);

